import React from 'react';
import './Cartoon.css';

function Cartoon() {
  return (
    <div className="cartoon-container">
      <h1>Cartoon</h1>
      <div className="video-wrapper">
        <video controls>
          <source src="/assets/videos/dancing.mp4" type="video/mp4" />
          Your browser does not support the video tag.
        </video>
      </div>
    </div>
  );
}

export default Cartoon;
